// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Lottery {

    uint256 constant internal BET_AMOUNT = 5 * 10 ** 15;
    uint256 constant internal BET_LENGTH = 2;
    bool internal mode = false;

    enum BettingResult {Fail, Win, Draw}

    event BET(address bettor, uint256 amount, uint256[BET_LENGTH] betNumArr);
    event WIN(address bettor, uint256 amount, uint256[BET_LENGTH] betNumArr, uint256[BET_LENGTH] answerNumArr);
    event DRAW(address bettor, uint256 amount, uint256[BET_LENGTH] betNumArr, uint256[BET_LENGTH] answerNumArr);
    event FAIL(address bettor, uint256 amount, uint256[BET_LENGTH] betNumArr, uint256[BET_LENGTH] answerNumArr);

    uint256 private pot;

    address payable admin;

    constructor() {
        admin = payable(msg.sender);
    }

    function getAdmin() public view returns (address) {
        return admin;
    }
    function getPot() public view returns (uint256 _pot) {
        return pot;
    }

    function checkNum(uint[BET_LENGTH] memory answerNumArr, uint[BET_LENGTH] memory betNumArr) public pure returns (BettingResult) {
        uint count = 0;

        for (uint i = 0; i < BET_LENGTH; i++) {
            for (uint j = 0; j < BET_LENGTH; j++) {
                if (answerNumArr[i] == betNumArr[j]) {
                    count++;
                    break;
                }
            }
        }

        if(count == BET_LENGTH) return BettingResult.Win;
        else if(count == 1) return BettingResult.Draw;
        else return BettingResult.Fail;
    }

    function bet(uint256[BET_LENGTH] memory betNumArray) public payable returns (bool) {
        require(msg.value == BET_AMOUNT, "Not enough ETH");
        address payable adrr = payable(msg.sender);

        uint256[BET_LENGTH] memory answerNumArr = getRandomNumbers();
        BettingResult bettingResult = checkNum(answerNumArr, betNumArray);


        emit BET(msg.sender, msg.value, betNumArray);

        if(bettingResult == BettingResult.Win){
            adrr.transfer(BET_AMOUNT + pot);
            pot = 0;
            emit WIN(msg.sender, msg.value, betNumArray, answerNumArr);
        }
        else if(bettingResult == BettingResult.Fail){
            pot += BET_AMOUNT;
            emit FAIL(msg.sender, msg.value, betNumArray, answerNumArr);
        }
        else{
            adrr.transfer(BET_AMOUNT);
            emit DRAW(msg.sender, msg.value, betNumArray, answerNumArr);
        }

        return true;
    }

    function getRandomNumbers() public view returns (uint256[BET_LENGTH] memory) {
        uint256[BET_LENGTH] memory randomNumbers;
        uint256 count = 0;
        uint256 randNum;
        bool isDuplicate;

        while (count < BET_LENGTH) {
            isDuplicate = false;
            randNum = (uint256(keccak256(abi.encodePacked(block.timestamp, block.prevrandao, count))) % 10) + 1;
            for(uint i = 0; i < count; i++) {
                if (randNum == randomNumbers[i]) {
                    isDuplicate = true;
                    break;
                }
            }
            if (!isDuplicate) {
                randomNumbers[count] = randNum;
                count++;
            }
        }

        uint256[BET_LENGTH] memory testData = [uint256(1), uint256(2)];
        return mode ? randomNumbers : testData;
    }
}
